import "bootstrap/dist/css/bootstrap.min.css";
import { Container } from "react-bootstrap";
import Card from "react-bootstrap/Card";
import "./RepoCard.css";

function TopCard() {
  return (
    <Container fluid="true">
      <div className="row">
        <div className="col-4"></div>
        <div className="col-4">
          <Card id="topCard">
            <Card.Body className="text-center">
              <Card.Title>
                These are my Top 12 most recently created repos{" "}
              </Card.Title>
              <Card.Subtitle>Have Fun!</Card.Subtitle>
            </Card.Body>
          </Card>
        </div>
        <div className="col-4"></div>
      </div>
    </Container>
  );
}

export default TopCard;
